function get_img_urls_from_bing_img_search() {
  let container = document.getElementById("mmComponent_images_2");

  let rows = Array.from(container.querySelectorAll(".dgControl_list "));
  rows = rows.filter((row) => row.dataset.row !== undefined);

  let imgs_arrays = [];
  rows.forEach((row) =>
    imgs_arrays.push(Array.from(row.querySelectorAll("img")))
  );
  let imgs = [];
  for (let i = 0; i < imgs_arrays.length; i++) {
    imgs = imgs.concat(imgs_arrays[i]);
  }
  imgs = imgs.map((img) => img.src);
}

